            }
          },
          default: {
            "description": "Invalid Request",
            "schema": {
              "$ref": "#/definitions/Error"
            }
          },
        }
      }
    },
  })),
  fp.keys,
  getFunctions,
)(model);


export const mapPaths = fp.flatMap(mapPath);

export default {
  mapPaths,
  mapDefinitions,
};

